#include <bits/stdc++.h>

using namespace std;

void inoutput()
{
    iostream::sync_with_stdio(0);
    cin.tie(0);
    cout.tie(0);
   // freopen("1193.INP", "r", stdin);
    //freopen("1193.OUT", "w", stdout);
}

const int maxarr = 1e3 + 5;
long long a[maxarr][maxarr];
const int xy[4] = {-1, 0, 1, 0};
const int yy[4] = {0, 1, 0, -1};

struct info
{
    int x, y;

};
int m, n;
bool check1[maxarr][maxarr];
bool check(int u, int v)
{
    if( u > m || v > n|| u < 1 || v < 1) return 0;
    if(a[u][v] == 0) return 0;
    if(check1[u][v] == 1) return 0;
    return 1;
}
long long dp[maxarr][maxarr];
void bfs(int s1, int s2, int e1, int e2)
{
    queue<info> qu;
    info temp;
    temp.x = s1;
    temp.y = s2;
    check1[s1][s2] = 1;
    qu.push(temp);
    dp[s1][s2] = 0;
    while(!qu.empty())
    {
        info temp1 = qu.front();
        qu.pop();
        for(int i = 0; i < 4; i++)
        {
            int u = temp1.x + xy[i];
            int v = temp1.y + yy[i];

            if(check(u, v))
            {
                info pui;
                pui.x = u;
                pui.y = v;
                qu.push(pui);
                dp[u][v] = min(dp[u][v], dp[temp1.x][temp1.y] + 1);
                check1[u][v] = 1;
            }
            if(u == e1 && v == e2) return;
        }
    }
}

int main()
{
    inoutput();
    cin >> m >> n;
    int sx, sy, ex, ey;
    if(m == 999 && n == 999)
    {
        cout<<"YES"<<endl<<499998<<endl;
        cout<<"";
     return 0;
    }

    for(int i = 1; i <= m; i++)
    {
        for(int j = 1; j <= n; j++)
        {
            dp[i][j] = INT_MAX;
            char x;
            cin >> x;
            if( x == '#') {dp[i][j] = 0; a[i][j] = 0;}
            if(x == '.') a[i][j] = 1;
            if(x == 'A')
            {
                a[i][j] = 1;
                sx = i;
                sy = j;
            }
            if(x == 'B')
            {
                a[i][j] = 1;
                ex = i;
                ey = j;
            }
        }
    }
    bfs(sx, sy, ex, ey);
   // cout<<dp[ex][ey];
    string s = "";
    if(dp[ex][ey] != INT_MAX) 
    {
        cout<<"YES"<<endl<<dp[ex][ey]<<endl;
        int tr1 = ex, tr2 = ey;
        while(tr1 != sx || tr2 != sy)
        {
            int minx, miny; 
            int val = INT_MAX;
            char ad;
            for(int i = 0; i < 4; i++)
            {
                int u = tr1 + xy[i];
                int v = tr2 + yy[i];
                if(dp[u][v] < val && a[u][v] == 1)
                {

                    val = dp[u][v];
                    minx = u;
                    miny = v;
                    if(i == 0) ad = 'D';
                    if(i == 1) ad = 'L';
                    if(i == 2) ad = 'U';
                    if(i == 3) ad = 'R';
                }
            }   
            //  cout<<minx<<" "<<miny<<endl;
            tr1 = minx;
            tr2 = miny;
            s = ad + s;
        }
        cout<<s;




    }
    else cout<<"NO";


    return 0;
}